import React from "react";
import styled from "styled-components";

function Home() {
  return (
    <Container>
      <Nav>
        <Logo>TABI</Logo>
        <NavRight>
          <NavRightBtn>Log In</NavRightBtn>
          <NavRightBtn>Sign Up</NavRightBtn>
        </NavRight>
      </Nav>
    </Container>
  );
}

export default Home;
const Container = styled.div`
  width: 100vw;
  display: flex;
  flex-direction: column;
`;
const Nav = styled.div`
  width: 100vw;
  height: 100px;
  display: flex;
  align-items: flex-start;
  justify-content: space-between;
  padding-top: 30px;
`;
const Logo = styled.p`
  font-size: 40px;
  font-weight: 700;
  margin-left: 30px;
`;
const NavRight = styled.div`
  display: flex;
  align-items: center;
  gap: 30px;
  margin-right: 30px;
`;
const NavRightBtn = styled.p`
  cursor: pointer;
  font-size: 18px;
`;
const NavBottom = styled.div`
  display: flex;
  align-items: center;
  gap: 30px;
  margin-left: 30px;
`;
const NavBottomBtn = styled.p`
  font-size: 35px;
  font-weight: 700;
  border-bottom: ${(props) =>
    props.selected === "true" ? "2px solid #000" : "none"};
`;
